import {listaProductos} from "../data2.js";

export function Categories() {
    return (
        <nav className="categories">
            <ul>
                {
                    listaProductos.map((product => {
                        return (
                            <li>{product.category}</li>
                        )
                    }))
                }
            </ul>
        </nav>
    )
}
